import * as React from 'react';
import { Button, View, Text, StatusBar, StyleSheet} from 'react-native';

export default class OnOffScreen extends React.Component {
	render(){
		return(
            <View style={styles.On_Off}>
                <StatusBar barStyle="dark-content" backgroundColor="#ecf0f1" />
                <Text>Switch On or Switch Off socket</Text>
            
                <Button
                    title="On_Off"
                    onPress={() => this.props.navigation.navigate("MainFunction")}
                />
            </View>
		)
	}
}

const styles = StyleSheet.create({
    On_Off: {
        backgroundColor: '#90FF33',
        flex: 1,
        alignItems: 'center',
        justifyContent: 'center'  
    }
});
